import Products from '../components/Products.js'
import { useContext } from 'react';
import CartContext from '../components/cartcontext';


const Cart = () => {
   const { cart } = useContext(CartContext);

   return(
     <div>
      <h3>Cart Items</h3>
      {cart.map(item => <Product key={item.id} product={item} />)}
     </div>
   )
}


export default Cart;
